import React from 'react';

const style={
    div:{
        position:'relative'
    },
    line:{
        zIndex:'-1',
        position:"absolute",
        borderLeft:"6px solid #0688FA"
    },
    icon:{
        zIndex:'0',
        position:'absolute'
    }      
}
export default function TimelineCard({iconURL,year,content}){
    return(
        <div className="d-flex flex-grow-1 flex-row  justify-content-between col-md-6 h-100">

            <p className="mb-md-0">{year} </p>

            <div className='m-0 p-0 h-100'>
                <div style={style.div} className=' m-0 p-0 h-100'>
                    <img className='u-icon u-icon--md' src={iconURL} alt='icon' />
                    <span style={style.line}></span>
                </div>
            </div>
            <p className="">
                {content}
            </p>
        </div>
    )
}
